      {id:'ab', name: 'G', age:27 },
      {id:'ac', name: 'Tito', age:18}
    ]
  }



  render() {


    return (
      <div className="App">
        <Titles />
        <h1> Race-day</h1>
        <p>Weather</p> 
      </div>
    );
  }
}

export default App;
